* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  background-color: cyan;
  display: grid;
  grid-template-rows: 1fr;
  grid-template-columns: 1fr;
  width: 100%;
  height: 100%;
  justify-items: center;
  align-items: center;
}
body #gameScreen {
  background-color: white;
  border: 2px solid black;
}
body img {
  display: none;
}
